import logo from './logo.svg';
import './App.css';
import React from 'react';
import {BrowserRouter, Route, Routes} from 'react-router-dom';
import Wordcloud from './wordcloud';


function App() {
  return (
    <div className="Inmotion">
        <BrowserRouter> 
        <Routes>
            <Route path="/wordcloud/" component={Wordcloud}/>
        </Routes>
        </BrowserRouter>
    </div>
  );
}

export default App;
